const ProfileContainer = (props) => {

    useEffect(() => {
        axios.get(`https://social-network.samuraijs.com/api/1.0/profile/{userId}`)
            .then(response => {
                props.setUserProfile(response.data);
                console.log(response.data);
            });
    }, [])

